import styled from 'styled-components';
import { View, Text } from 'react-native';

export const MainView = styled(View)`
  flex: 1;
  background-color: #000000;
  align-items: center;
  justify-content: center;
`;

export const MainText = styled(Text)`
  color: #ffffff;
`;
